export default function Feature() {
  return (
    <div className='container-fluid' style={{ borderTop: '2px solid black', marginTop: '150px' }}>
        <div className="row">
            <div className="col-sm-6 d-flex align-items-center justify-content-center">
                <div className="text-center">first</div>
            </div>
            <div className="col-sm-6 p-0 mt-4">
                <img 
                    src="https://yellow.ai/wp-content/uploads/2024/06/healthcare-inline-img-2-1-1010x1024.webp" 
                    alt="" 
                    style={{ width: '100%', height: 'auto', display: 'block' }} 
                />
            </div>
        </div>
    </div>
  );
}
